import React, { useContext, useState } from 'react';
import { Link } from 'react-router-dom';
import '../index.css';
import axios from 'axios';

const ThemeContext = React.createContext();

const App = () => {
  const [theme, setTheme] = useState('light');

  const toggleTheme = () => {
    setTheme(theme === 'light' ? 'dark' : 'light');
  };

  return (
    <ThemeContext.Provider value={theme}>
      <div className="App">
        <Navbar toggleTheme={toggleTheme} />
        <Content />
      </div>
    </ThemeContext.Provider>
  );
};

const Navbar = ({ toggleTheme }) => {
  const theme = useContext(ThemeContext);

  const navbarStyle = {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '1rem',
    background: theme === 'light' ? 'white' : '#12121296',
    color: theme === 'light' ? 'black' : 'white',
  };

  const ulStyle = {
    listStyle: 'none',
    margin: 0,
    padding: 0,
    display: 'flex',
  };

  const liStyle = {
    marginRight: '20px',
  };

  return (
    <nav style={navbarStyle}>
      <ul style={ulStyle}>
        <li style={liStyle}>
          <Link to="/home">Home</Link>
        </li>
        <li style={liStyle}>
          <Link to="/contacto">Contacto</Link>
        </li>
        <li style={liStyle}>
          <Link to="/favs">Favoritos</Link>
        </li>
      </ul>
      <button onClick={toggleTheme}>Cambiar Tema</button>
    </nav>
  );
};

const Content = () => {
  const theme = useContext(ThemeContext);

  // Estilos condicionales para cambiar el color del contenido según el tema
  const contentStyle = {
    background: theme === 'light' ? 'white' : '#12121296',
    color: theme === 'light' ? 'black' : 'white',
  };

  return (
    <div className="content" style={contentStyle}>
      {/* Coloca aquí el contenido de tus rutas */}
      <Contacto />
      <Detail />
      <Home />
      <Favoritos />
    </div>
  );
};

// Componente Home
const Home = () => {
  return (
    <div>
      <h1>Home</h1>
      <p>Este es el componente Home</p>
    </div>
  );
};

// Componente Favoritos
const Favoritos = () => {
  return (
    <div>
      <h1>Favoritos</h1>
      <p>Este es el componente Favoritos</p>
    </div>
  );
};

// Componente Contacto
const Contacto = () => {
